            <tspan style="white-space:pre" x="7" y="12.8">Toujours un (jamais plus d'1 à la fois, surtout au début) </tspan>

        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Sans Serif'; font-size:9pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>Dégagez du temps libre dans votre agenda, si possible une fois par semaine et toujours au même créneau, pour vous consacrer à votre projet d’apprentissage&lt;/span>&lt;/p>&lt;/body>">

        </g>
    </g>

    </g>

    <g ed:layout="leftmap" ed:width="153.906" ed:parentid="131" id="136" transform="matrix(1,0,0,1,562,1062.46)" ed:height="37.5">

        <text class="st5">
            <tspan style="white-space:pre" x="7" y="12.8">ACTIVITÉ:</tspan>
            <tspan style="white-space:pre" x="7" y="29.8">La Synesthésie</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Sans Serif'; font-size:9pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>La &amp;quot;synesthésie&amp;quot; est un phénomène psychoneurologique qui décrit l'association entre une perception et une expérience. En l'occurrence, en associant une couleur avec une intelligence vous renforcez votre capacité à la mémoriser, à la reconnaitre et à l'utiliser au moment opportun.&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(128,10)" xlink:href="#imgnote"/>
        </g>
        <g ed:comment="[&#xa;    {&#xa;        &quot;Date&quot;: 1635229123,&#xa;        &quot;Message&quot;: &quot;Par exemple : si vous associez consciemment la couleur bleue à l'intelligence interpersonnelle, vous pourriez voir et analyser les situations sociales \&quot;avec un filtre bleu\&quot;.&quot;,&#xa;        &quot;Name&quot;: &quot;mirai&quot;&#xa;    },&#xa;    {&#xa;        &quot;Date&quot;: 1635229116,&#xa;        &quot;Message&quot;: &quot;En associant toutes vos connaissances en sciences sociales à cette même couleur, vous pourrez plus facilement y accéder et les avoir à l'esprit.&quot;,&#xa;        &quot;Name&quot;: &quot;mirai&quot;&#xa;    }&#xa;]&#xa;">
            <use transform="translate(111,10)" xlink:href="#imgcomment"/>
        </g>
    </g>

        <g ed:note="&lt;body style=&quot; font-family:'Sans Serif'; font-size:9pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>- Chance = opportunité + préparation + motivation &lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>- Opportunité = (nouvel) Environnement + (nouvel) Perspective (futur proche) &lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>- Bonne/mauvaise opportunité: Retour sur apprentissage = Gains / Pertes &lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>- Coût d'opportunité = Argent + Temps + Énergie &lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Arial';&quot;>&lt;br />&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Arial';&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>- Une bonne opportunité devrait vous motiver intrinsèquement. &lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>- Menaces: Menace =&amp;gt; Malchance = Opportunité + Manque de préparation + Amotivation &lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>- Scénarios catastrophes ; &lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>- Erreurs malencontreuses ; &lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>- Fautes professionnelles récurrentes&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(165,10)" xlink:href="#imgnote"/>
        </g>
    </g>

        <g ed:note="&lt;body style=&quot; font-family:'Sans Serif'; font-size:9pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>- Étudier ce que font les personnes qui maîtrisent le domaine ou le sujet visé. &lt;br />&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>- En vous inspirant de leurs attitudes, habitudes et tactiques, vous pourrez &amp;quot;emprunter&amp;quot; un peu de leur intelligence. &lt;br />&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>- Trouver un Role Model =&amp;gt; &lt;br />&#x9;1 pour trouver de petits objectifs, &lt;br />&#x9;2 se comparer un quelqu'un que l'on estime, &lt;br />&#x9;3 et tenter de lui ressembler en le mimant leurs intelligences&lt;/span>&lt;/p>&lt;/body>">

        </g>

        <text class="st5">
            <tspan style="white-space:pre" x="8" y="11.8">APPRENTISSAGE ACTIF</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Sans Serif'; font-size:9pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>L’apprentissage actif: &lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>=&amp;gt; combinez un maximum de vos sens en vous livrant à des activités aussi réalistes et donc engageantes que possible. &lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>=&amp;gt; afin de mémoriser le travail fait, s’entraîner à réexpliquer à quelqu’un, à quelque chose, ou encore à soit même, ce que l’on vient d’apprendre&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Arial';&quot;>&lt;br />&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'Arial';&quot;>&lt;br />&lt;/p>&lt;/body>">
            <use transform="translate(163,0)" xlink:href="#imgnote"/>
        </g>
    </g>

        <use x="0" transform="translate(7,22)" y="0" height="165" xlink:href="#image10" width="260"/>
        <text class="st5">
            <tspan style="white-space:pre" x="22" y="11">TECHNIQUE DE MÉMORISATION</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'Sans Serif'; font-size:9pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'Arial';&quot;>2 types de mémoires: &lt;br />- mémoire procédurale ou implicite=&amp;gt; stockez et accédez consciemment à des informations pour les exprimer par le langage (séances de 20 et 30 minutes) &lt;br />- mémoire déclarative, ou explicite=&amp;gt; répétez des gestes pour en faire des automatismes (séances de 5 et 10 minutes)&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(232,0)" xlink:href="#imgnote"/>
        </g>
